            {/*                Announcing our next round of funding.{' '}*/}
            {/*                <a href="#" className="font-semibold text-indigo-600">*/}
            {/*                    <span aria-hidden="true" className="absolute inset-0"/>*/}
            {/*                    Read more <span aria-hidden="true">&rarr;</span>*/}
